root.render(
    <React.Fragment>
    <h1 className='heading1'>Top Five MxPlayer Series</h1>
    {sData.map(function(val){

        return (
            <Cards srcImage={val.srcImage} title="Hello" typeTrend="Trending"></Cards>
        )
    })}
    </React.Fragment>

);
